import { useDispatch, useSelector } from "react-redux"
import { resetUtente } from "../store/slice/utenteSlice";
import { useHistory } from "react-router-dom/cjs/react-router-dom";
import { APRI_CONTO, DEPOSITO, ERRORE, HOME, PRELIEVO } from "../utility/Route";
import { findConto } from "../service/utenteService";
import { useState, useEffect } from "react";
import { setConto } from "../store/slice/contoSlice";
import { resetConto } from "../store/slice/contoSlice";



function IndexUtente({setErrore}) {


    const utente = useSelector(state => state.utente);
    const dispatch = useDispatch();
    const history = useHistory()
    const conto = useSelector(state => state.conto);

useEffect(() => {
    
  if(utente.ruolo){
    if (utente.ruolo.id == 2) {

    } else {
        const errore = {
            titoloErrore: "ACCESSO NON AUTORIZZATO",
            descrizioneErrore: "Non hai i permessi per visualizzare la pagina"
        }
        setErrore(errore);
        history.push(ERRORE)
    }
} else {
    const errore = {
        titoloErrore: "UTENTE NON RICONOSCIUTO",
        descrizioneErrore: "Effettua il login"
    }
    setErrore(errore);
    history.push(ERRORE)
}

    findConto(utente).then ((response)=>{
        console.log("ok")
        if(response.data){
            dispatch(setConto(response.data))
        }
    }).catch(error =>{
        console.log(error)
      })
}, []);
    

    function logout() {

        dispatch(resetUtente())
        dispatch(resetConto())
        history.push(HOME)

    }

    function reindirizza(rotta) {
        history.push(rotta)
    }

    function apriConto(rotta) {
        if(conto==null){
            history.push(rotta)
        }else alert("hai gia un conto")
    }

    function datiConto(conto){
        if (!conto) {
            return <p>Non hai un conto</p>;
          }
          if (!conto.stato) {
            return <p>Caricamento...</p>;
          }
        
          return (
            <>
              <p style={{ marginBottom: 0 }}>
                <b>Numero conto:</b> {conto.numero_conto}
              </p>
              <p style={{ marginBottom: 0 }}>
                <b>Stato conto:</b> {conto.stato.stato_conto_corrente}
              </p>
              <p style={{ marginBottom: -10 }}>
                <b>Saldo:</b> € {conto.saldo}
              </p>
            </>
          );
        }

    return (
        <>
            {console.log("INDEX")}

        
            <div className="div">

                <div className="div-container">
                    <h3><b>Benvenuto {utente.nome} {utente.cognome}</b> </h3>
                    <h6><b>Ruolo: {(utente.ruolo) ? <>{utente.ruolo.tipo_ruolo} </>  : <></> }</b> </h6>
                    <p><b>{datiConto(conto)}</b></p>
                    <p><b>Operazioni disponibili</b></p>
                    <button type="button" onClick={ ()=>reindirizza(DEPOSITO)}>Fai un deposito</button>
                    <button type="button" onClick={ ()=>reindirizza(PRELIEVO)}>Effettua un prelievo</button>
                    <button type="button">Effettua un bonifico</button>
                    <button type="button">Lista transazioni</button>
                    <button type="button" id="logout" onClick={() => apriConto(APRI_CONTO)}>Apri conto</button>
                    <button type="button" id="logout" onClick={() => logout()}>Logout</button>
                </div>
            </div>
            



        </>
    )









} export default IndexUtente
